		<div class="stl_02">
			<div class="stl_03">
				<img src="data:image/png;base64," alt="" class="stl_04" />
			</div>
			<div class="stl_view">
				<div class="stl_05 stl_06">
					<div class="stl_01" style="top: 3.4831em; left:18.3299em;"><span class="stl_07 stl_08" style="word-spacing:0.08em;">Direct Selling Agent Agreement &nbsp;</span></div>
					<div class="stl_01" style="top: 10.6563em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.53em;">THIS AGREEMENT (the "Agreement") is made on <?=$f['registration_date']?>, by and between AVELOUN &nbsp;</span></div>
					<div class="stl_01" style="top: 12.3763em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.25em;">MARKETING PRIVATE LIMITED, a Company</span><span class="stl_09 stl_08" style="word-spacing:0.22em;">&nbsp;incorporated under the provisions of the Companies</span><span class="stl_09 stl_08" style="word-spacing:0.19em;">&nbsp;Act, &nbsp;</span></div>
					<div class="stl_01" style="top: 14.0595em; left:24.6799em;"><span class="stl_10 stl_11">nd &nbsp;</span></div>
					<div class="stl_01" style="top: 14.1063em; left:3.75em;"><span class="stl_09">2</span></div>
					<div class="stl_01" style="top: 15.8263em; left:3.75em;"><span class="stl_09">2</span></div>
					<div class="stl_01" style="top: 14.1063em; left:4.25em;"><span class="stl_09 stl_08" style="word-spacing:0.27em;">013 and having its registered office at CS</span><span class="stl_09 stl_08" style="word-spacing:0.22em;">&nbsp;58 2</span><span class="stl_09 stl_08" style="word-spacing:0.91em;">&nbsp;Floor,</span><span class="stl_09 stl_08" style="word-spacing:0.28em;">&nbsp;Ansal Plaza Vaishali Ghaziabad, Uttar</span><span class="stl_09 stl_08" style="word-spacing:0.28em;">&nbsp;Pradesh &nbsp;</span></div>
					<div class="stl_01" style="top: 15.8263em; left:4.25em;"><span class="stl_09 stl_08" style="word-spacing:0.91em;">01010, (the</span><span class="stl_09 stl_08" style="word-spacing:0.19em;">&nbsp;"Company")</span><span class="stl_09 stl_08" style="word-spacing:0.16em;">&nbsp;and</span><span class="stl_09 stl_08" style="word-spacing:0.18em;">&nbsp;<?=$f['first_name']." ".$f['last_name']?></span><span class="stl_09 stl_08" style="word-spacing:0.18em;">&nbsp;(the "Direct Selling Agent"). &nbsp;</span></div>
					<div class="stl_01" style="top: 21.0063em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.07em;">NOW, THEREFORE, in consideration of the mutual promises contained herein, the parties agree as follows: &nbsp;</span></div>
					<div class="stl_01" style="top: 24.4563em; left:3.75em;"><span class="stl_12">1</span></div>
					<div class="stl_01" style="top: 24.4563em; left:4.25em;"><span class="stl_12" style="word-spacing:0em;">. Definitions &nbsp;</span></div>
					<div class="stl_01" style="top: 27.0363em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.06em;">As used herein, the following terms shall have the meanings set forth below: &nbsp;</span></div>
					<div class="stl_01" style="top: 29.6262em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.11em;">A. “Goods”</span><span class="stl_09 stl_08" style="word-spacing:0.08em;">&nbsp;means</span><span class="stl_09 stl_08" style="word-spacing:0.07em;">&nbsp;goods as</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;defined</span><span class="stl_09 stl_08" style="word-spacing:0.06em;">&nbsp;in the</span><span class="stl_09 stl_08" style="word-spacing:0.06em;">&nbsp;Sale</span><span class="stl_09 stl_08" style="word-spacing:0.06em;">&nbsp;of</span><span class="stl_09 stl_08" style="word-spacing:0.07em;">&nbsp;Goods</span><span class="stl_09 stl_08" style="word-spacing:0.07em;">&nbsp;Act, 1930</span><span class="stl_09 stl_08" style="word-spacing:0.07em;">&nbsp;and</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;“Service”</span><span class="stl_09 stl_08" style="word-spacing:0.07em;">&nbsp;means</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;service</span><span class="stl_09 stl_08" style="word-spacing:0.06em;">&nbsp;as</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;defined</span><span class="stl_09 stl_08" style="word-spacing:0.05em;">&nbsp;in &nbsp;</span></div>
					<div class="stl_01" style="top: 31.3563em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.08em;">the Consumer Protection Act, 1986. &nbsp;</span></div>
					<div class="stl_01" style="top: 33.9363em; left:3.75em;"><span class="stl_09" style="word-spacing:0.09em;">B. "Territory"</span><span class="stl_09 stl_08" style="word-spacing:0.16em;">&nbsp;shall</span><span class="stl_09 stl_08" style="word-spacing:0.15em;">&nbsp;be allocated during time</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;of</span><span class="stl_09 stl_08" style="word-spacing:0.15em;">&nbsp;engagement by the</span><span class="stl_09 stl_08" style="word-spacing:0.15em;">&nbsp;Company</span><span class="stl_09 stl_08" style="word-spacing:0.12em;">&nbsp;in</span><span class="stl_09 stl_08" style="word-spacing:0.14em;">&nbsp;writing to the Direct</span><span class="stl_09 stl_08" style="word-spacing:0.17em;">&nbsp;Selling &nbsp;</span></div>
					<div class="stl_01" style="top: 35.6663em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.23em;">Agent. Any change in "Territory" shall be communicated by the Company</span><span class="stl_09 stl_08" style="word-spacing:0.2em;">&nbsp;in writing to the Direct</span><span class="stl_09 stl_08" style="word-spacing:0.23em;">&nbsp;Selling &nbsp;</span></div>
					<div class="stl_01" style="top: 37.3863em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.06em;">Agent from time to time. &nbsp;</span></div>
					<div class="stl_01" style="top: 39.9763em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.17em;">C. "Direct Selling Agent" means</span><span class="stl_09 stl_08" style="word-spacing:0.12em;">&nbsp;a</span><span class="stl_09 stl_08" style="word-spacing:0.15em;">&nbsp;person</span><span class="stl_09 stl_08" style="word-spacing:0.18em;">&nbsp;appointed or authorized, directly or</span><span class="stl_09" style="word-spacing:0.1em;">&nbsp;indirectly,</span><span class="stl_09 stl_08" style="word-spacing:0.14em;">&nbsp;by a Direct</span><span class="stl_09 stl_08" style="word-spacing:0.17em;">&nbsp;Selling &nbsp;</span></div>
					<div class="stl_01" style="top: 41.7063em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.32em;">Entity through a legally enforceable written contract to undertake direct selling business on principal to &nbsp;</span></div>
					<div class="stl_01" style="top: 43.4262em; left:3.75em;"><span class="stl_09" style="word-spacing:0em;">principal basis. &nbsp;</span></div>
					<div class="stl_01" style="top: 48.6063em; left:3.75em;"><span class="stl_12">2</span></div>
					<div class="stl_01" style="top: 48.6063em; left:4.25em;"><span class="stl_12" style="word-spacing:0em;">. Appointment &nbsp;</span></div>
					<div class="stl_01" style="top: 51.1863em; left:3.75em;"><span class="stl_09" style="word-spacing:0.05em;">Company hereby</span><span class="stl_09 stl_08" style="word-spacing:0.14em;">&nbsp;appoints</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;Direct</span><span class="stl_09 stl_08" style="word-spacing:0.13em;">&nbsp;Selling</span><span class="stl_09 stl_08" style="word-spacing:0.09em;">&nbsp;Agent as</span><span class="stl_09 stl_08" style="word-spacing:0.09em;">&nbsp;its</span><span class="stl_09" style="word-spacing:0.04em;">&nbsp;non-exclusive</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;selling agent</span><span class="stl_09 stl_08" style="word-spacing:0.09em;">&nbsp;for</span><span class="stl_09 stl_08" style="word-spacing:0.13em;">&nbsp;the goods/services</span><span class="stl_09 stl_08" style="word-spacing:0.08em;">&nbsp;in</span><span class="stl_09 stl_08" style="word-spacing:0.08em;">&nbsp;the &nbsp;</span></div>
					<div class="stl_01" style="top: 52.9163em; left:3.75em;"><span class="stl_09" style="word-spacing:0.04em;">territory, and</span><span class="stl_09 stl_08" style="word-spacing:0.1em;">&nbsp;Direct Selling</span><span class="stl_09 stl_08" style="word-spacing:0.07em;">&nbsp;Agent</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;hereby accepts such appointment.</span><span class="stl_09 stl_08" style="word-spacing:0.09em;">&nbsp;Direct Selling Agent's</span><span class="stl_09 stl_08" style="word-spacing:0.07em;">&nbsp;sole</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;authority</span><span class="stl_09 stl_08" style="word-spacing:0.07em;">&nbsp;shall &nbsp;</span></div>
					<div class="stl_01" style="top: 54.6363em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.13em;">be to</span><span class="stl_09 stl_08" style="word-spacing:0.17em;">&nbsp;solicit customers for the goods/services in</span><span class="stl_09 stl_08" style="word-spacing:0.15em;">&nbsp;the territory in</span><span class="stl_09 stl_08" style="word-spacing:0.17em;">&nbsp;accordance with</span><span class="stl_09 stl_08" style="word-spacing:0.13em;">&nbsp;the terms</span><span class="stl_09 stl_08" style="word-spacing:0.13em;">&nbsp;of this</span><span class="stl_09 stl_08" style="word-spacing:0.18em;">&nbsp;agreement. &nbsp;</span></div>
					<div class="stl_01" style="top: 56.3663em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.06em;">Direct Selling Agent shall not have the authority to make any commitments whatsoever on behalf of Company. &nbsp;</span></div>
				</div>
			</div>
		</div>
		<div class="stl_02">
			<div class="stl_view">
				<div class="stl_05 stl_06">
					<div class="stl_01" style="top: 5.1863em; left:3.75em;"><span class="stl_12">3</span></div>
					<div class="stl_01" style="top: 5.1863em; left:4.25em;"><span class="stl_12 stl_08" style="word-spacing:0.07em;">. General Duties &nbsp;</span></div>
					<div class="stl_01" style="top: 7.7763em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.23em;">Direct Selling Agent shall use his best efforts to promote the goods/services</span><span class="stl_09 stl_08" style="word-spacing:0.21em;">&nbsp;and maximize the sale of</span><span class="stl_09 stl_08" style="word-spacing:0.19em;">&nbsp;the &nbsp;</span></div>
					<div class="stl_01" style="top: 9.5063em; left:3.75em;"><span class="stl_09" style="word-spacing:0.14em;">goods/services in</span><span class="stl_09 stl_08" style="word-spacing:0.19em;">&nbsp;the territory.</span><span class="stl_09 stl_08" style="word-spacing:0.21em;">&nbsp;Direct</span><span class="stl_09 stl_08" style="word-spacing:0.19em;">&nbsp;Selling Agent</span><span class="stl_09 stl_08" style="word-spacing:0.2em;">&nbsp;shall also provide reasonable assistance to Company</span><span class="stl_09 stl_08" style="word-spacing:0.15em;">&nbsp;in &nbsp;</span></div>
					<div class="stl_01" style="top: 11.2263em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.31em;">promotional activities in the territory.</span><span class="stl_09 stl_08" style="word-spacing:0.28em;">&nbsp;Direct Selling Agent will assist the company by taking part in</span><span class="stl_09 stl_08" style="word-spacing:0.25em;">&nbsp;all &nbsp;</span></div>
					<div class="stl_01" style="top: 12.9563em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.08em;">promotional events; use the marketing inputs judiciously for maximizing orders for the company. &nbsp;</span></div>
					<div class="stl_01" style="top: 16.4063em; left:3.75em;"><span class="stl_12">4</span></div>
					<div class="stl_01" style="top: 16.4063em; left:4.25em;"><span class="stl_12 stl_08" style="word-spacing:0.08em;">. Reserved Rights &nbsp;</span></div>
					<div class="stl_01" style="top: 18.9863em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.26em;">Company reserves the right to solicit/engage other Agents, Direct Selling Agents directly from businesses &nbsp;</span></div>
					<div class="stl_01" style="top: 20.7163em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.28em;">within the territory.</span><span class="stl_09 stl_08" style="word-spacing:0.25em;">&nbsp;Direct Selling Agent's task is to solicit customers from all potential businesses in</span><span class="stl_09 stl_08" style="word-spacing:0.22em;">&nbsp;the &nbsp;</span></div>
					<div class="stl_01" style="top: 22.4363em; left:3.75em;"><span class="stl_09 stl_13">territory<span class="stl_08">. &nbsp;</span></span></div>
					<div class="stl_01" style="top: 25.8863em; left:3.75em;"><span class="stl_12">5</span></div>
					<div class="stl_01" style="top: 25.8863em; left:4.25em;"><span class="stl_12 stl_08" style="word-spacing:0.06em;">. Conflict of Interest &nbsp;</span></div>
					<div class="stl_01" style="top: 28.4763em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.15em;">Direct Selling Agent</span><span class="stl_09 stl_08" style="word-spacing:0.13em;">&nbsp;warrants to</span><span class="stl_09 stl_08" style="word-spacing:0.13em;">&nbsp;Company</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;that</span><span class="stl_09 stl_08" style="word-spacing:0.08em;">&nbsp;it</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;does</span><span class="stl_09 stl_08" style="word-spacing:0.09em;">&nbsp;not</span><span class="stl_09 stl_08" style="word-spacing:0.16em;">&nbsp;currently</span><span class="stl_09 stl_08" style="word-spacing:0.15em;">&nbsp;represent</span><span class="stl_09 stl_08" style="word-spacing:0.12em;">&nbsp;or promote any</span><span class="stl_09" style="word-spacing:0.07em;">&nbsp;Goods/services &nbsp;</span></div>
					<div class="stl_01" style="top: 30.2063em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.21em;">that compete with the Company's</span><span class="stl_09 stl_08" style="word-spacing:0.21em;">&nbsp;Goods/services. During the term of this Agreement, Direct Selling</span><span class="stl_09 stl_08" style="word-spacing:0.18em;">&nbsp;Agent &nbsp;</span></div>
					<div class="stl_01" style="top: 31.9262em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.11em;">shall not</span><span class="stl_09 stl_08" style="word-spacing:0.12em;">&nbsp;represent,</span><span class="stl_09 stl_08" style="word-spacing:0.1em;">&nbsp;promote</span><span class="stl_09 stl_08" style="word-spacing:0.08em;">&nbsp;or otherwise</span><span class="stl_09 stl_08" style="word-spacing:0.07em;">&nbsp;try</span><span class="stl_09 stl_08" style="word-spacing:0.06em;">&nbsp;to sell</span><span class="stl_09 stl_08" style="word-spacing:0.08em;">&nbsp;within</span><span class="stl_09 stl_08" style="word-spacing:0.06em;">&nbsp;the</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;Territory</span><span class="stl_09 stl_08" style="word-spacing:0.1em;">&nbsp;any Goods/services that, in</span><span class="stl_09 stl_08" style="word-spacing:0.12em;">&nbsp;Company's &nbsp;</span></div>
					<div class="stl_01" style="top: 33.6563em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.08em;">judgment, compete with the Goods/services covered by this Agreement. &nbsp;</span></div>
					<div class="stl_01" style="top: 37.1063em; left:3.75em;"><span class="stl_12">6</span></div>
