					<div class="stl_01" style="top: 39.6863em; left:3.75em;"><span class="stl_09 stl_08" style="word-spacing:0.13em;">Direct Selling Agent</span><span class="stl_09 stl_08" style="word-spacing:0.07em;">&nbsp;is</span><span class="stl_09 stl_08" style="word-spacing:0.06em;">&nbsp;an</span><span class="stl_09 stl_08" style="word-spacing:0.14em;">&nbsp;independent contractor, and</span><span class="stl_09 stl_08" style="word-spacing:0.12em;">&nbsp;nothing contained</span><span class="stl_09 stl_08" style="word-spacing:0.08em;">&nbsp;in</span><span class="stl_09 stl_08" style="word-spacing:0.11em;">&nbsp;this Agreement</span><span class="stl_09 stl_08" style="word-spacing:0.1em;">&nbsp;shall</span><span class="stl_09 stl_08" style="word-spacing:0.06em;">&nbsp;be</span><span class="stl_09 stl_08" style="word-spacing:0.13em;">&nbsp;construed &nbsp;</span></div>
